"policy_shipping": "Standard flat rate shipping for prints costs $3.50. I will combine shipping for a lower rate if you purchase more than one item at a time. I charge a flat rate of $20 to ship paintings. If you want expedited shipping, please let me know so I can get a quote for you.",
"policy_refunds": "I do everything myself so I am feel confident saying everything I make is quality guaranteed. If for some reason you are not happy with your purchase, you may return it for a full refund, or exchange it for another. ",
"policy_additional": "I also accept donations for art supplies at https://www.wepay.com/donations/angel-s-art-supply-fund.",
"policy_seller_info": "Robyn Angelizabeth Howard\r\n11215 Research Blvd. Apt. #2164 \r\nAustin, TX 78759 \r\nwww.angellaveaux.com\r\nangel.laveaux@gmail.com",
"policy_updated_tsz": 1344975835,
"vacation_autoreply": "Hello and thanx for stopping by! This shop is on vacation while I relocate. It should re-open the first week of June. I&#39;ll post notifications on my Facebook page and also in my blog at my personal web site, www.angellaveaux.com. I&#39;ll see you real soon!\r\n\r\nXO,\r\nAngel Laveaux",
