"announcement": "               ☠Welcome to Weirdplush.☠\r\n          Your one stop SHOP for everything WEIRD!\n\r\nAll Weirdplush Product Come Wrapped And Ready For Gift Giving.\r\n\r\n                   Weird*steampunk*cute*goth*spooky*scary*cool*\r\n\r\n   I specialize in handcrafted unique soap, coffins, bags, potions, jewelry and accessories. \r\n    All items are handcrafted with a dark heart and twisted imagination. \nTake a look around. Hope you enjoy!\n           ☠ Follow Weirdplush on facebook ☠\r\n    for  giveaways, coupons and facebook only offers!\n\n                     Facebook.com/weirdplush\n                      twitter.com@weirdplush\r\n                    Pinterest.com/weirdplush\r\n               instagram: Rebecca_Weirdplush\r\n\r\n                     Check us out on YouTube!!\r\n                    http://youtu.be/9L6s_4amd8U \r\n      \r\n                 ~~~~Trade Friendly Shop!! ~~~~\r\n             ♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥\r\n  Custom and Bulk Orders can be done on most items.\r\n     Just message to receive a quote. :)\r\n\r\n ~☠ ☠☠ NO quantity is TOO large. Just ask:)☠☠☠~\r\n♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥♥\r\n\r\nSee shop policies and shipping times before any purchase, ESPECIALLY international orders:)\r\n\r\nStarting January 27th, 2013 USPS rates will increase. Weirdplush shipping rates will adjust to USPS standards. Please read here for more details.: http://www.etsy.com/blog/news/2013/shipping-rates-update-for-sellers/\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "Weirdplush, Where the strange and unusual are always welcome!!\r\n\r\nWeirdplush is currently on vacation and will be back on ...\r\n\r\nPlease visit us again!",
"sale_message": "Thank you for your business. \r\nAll items are shipped out within 3-8 business days upon payment. \r\n\r\nFor Custom orders please allow 1-2 weeks for items to be made and processed. \r\nShipping arrival time depends on location.\r\n \r\nMost U.S. orders arrive in 7-20 days from date shipped. \r\n\r\nInternational Orders arrive in approximately 7-38 days due to customs dept. \r\nShipping time varies with each country. \r\n\r\nSee shop Policies to verify shipping and return terms. \r\n\r\n\r\nThank you for shopping wEiRdpLuSh.:)",
"digital_sale_message": null,
