"login_name": "weirdplush",
"accepts_custom_requests": true,
"policy_welcome": "Here at wEiRdpLuSh we pride ourselves on top notch customer service with friendly convos, timely feedback, extra coupon offers and excellent freebies.\r\nEverything can be resolved with friendly, yet professional communication.\r\nPlease email me directly (weirdplush@gmail.com or here thru convo) with your concerns, you are important to us.\r\n\r\nThank you for shopping at wEiRdpLuSh!!\r\nWhere the strange and unusual are always welcome!:)\r\nweird plush steampunk spooky gothic cool bridal\r\n\r\nOffering bulk orders on most items, No amount is too small or too big, just convo me.:)",
"policy_payment": "I accept paypal and credit cards as a form of payment.\r\n\r\n\r\n",
"policy_shipping": "ITEMS SHIPPED WITHIN THE U.S.: I ship all of my items purchased and shipped within the U.S. via USPS First Class Mail Parcels or Priority Mail with tracking number. I also do a delivery confirmation for extra fee for all US orders, which will be emailed to you once item is marked as shipped. All items are shipped within 2-8 days of purchase. Delivery of item shipped within the U.S. depends on the speed of U.S.P.S. First Class Parcels mail, but usually takes between 3-14 business days. We are not responsible for lost packages. Lost package claims must be opened by USPS postal service. NO REFUNDS OF ANY KIND ON LOST PACKAGES. This is the risk you take with your purchase.\r\n\r\n\r\n\r\nITEMS SHIPPED OUTSIDE OF THE U.S. (INTERNATIONAL ORDERS): All International orders will be shipped out USPS First Class International. Delivery confirmation is not offered for international orders. International orders can not be tracked. We are not responsible for items held in customs and lost orders. NO REFUNDS OF ANY KIND ON LOST PACKAGES This is the risk you take with your purchase.\r\nDelivery of item shipped outside of the U.S. (International Orders) will depend on the customs department of each country and the speed of shipment within the country the item is being shipped to. Most orders arrive within 14 to 90 days of shipped date. I will convo you when I ship the item and please convo in return when your item has arrived. This will better help to provide us with accurate travel times. Shipping time varies within each country and weirdplush is not responsible for how long it is going to take an item to arrive to you. Consider the possible lengthy time before you purchase.\r\n\r\n\r\n",
"policy_refunds": "Weirdplush is not held responsible for international lost orders. To insure that you do not have a lost package, you can OPT for insurance, and in the case of you wanting insurance please convo me at the time of purchase. Insurance will cost extra between 30-100 dollars depending on country.\r\n\r\n NO REFUNDS OF ANY KIND ON LOST PACKAGES.\r\n\r\nDamaged items:\r\n All U.S. shipped items totalling over 50 dollars will have insurance included at the time of checkout. Damage inflicted by poor handling through the postal service is covered by insurance.\r\n   Damaged items under a 50 dollar value may be approved for replacement if pictures of the damaged item is emailed within a week of arrival. In certain cases damaged item will be requested for return.\r\n\r\nWeirdplush accepts a return of the price of the item minus shipping cost within 2 days of receiving your item, which will be verified by the delivery confirmation number provided through convos or PayPal for each item sold . You will be held responsible for all return product shipping expenses.  Once determination of returned item is in original condition and reason for return has been verified, your money will be refund to you within 3 days of the returned item&#39;s arrival.\r\n",
"policy_additional": "››feedback››\r\n Please leave good feedback. Here at wEiRdpLuSh we will always leave feedback for you and ask that you do the same.  A lot of time is invested into each handmade item and to run a little shop, it relies on good customer feedback. If something went wrong with your shopping experience here at WEIRDPLUSH, please convo or e-mail me at weirdplush(@)gmail(.)com to get the situation resolved. Any false negative feedback will be reported to the Etsy corporation immediately.\r\n",
"policy_seller_info": "Weirdplush is an online craft store specializing in handmade, unique items and  owned by:\r\nRebecca Shumway\r\nHuntsville, Alabama\r\nweirdplush@gmail.com\r\n                           ",
