"login_name": "karenwiand",
"accepts_custom_requests": false,
"policy_welcome": "Welcome to my shop! Thanks for visiting Hell&#39;s Kitten. Please note that the majority of pieces in my shop are made to order, and made by myself individually. There is sometimes a longer wait because of this but I will make sure to inform you of any kind of delay if necessary. ",
"policy_payment": "Payment is expected to be completed immediately or ASAP. I do not fulfill orders or ship orders out until payment is received. ",
"policy_shipping": "*SHIPPING INFO* *****PLEASE READ*****\r\n\r\nI ship orders out one to two times a week. Less or more depending on the number of orders completed and processing. I ship first class with USPS. I usually pay the extra dollar for tracking numbers and you will receive yours via email. I do not purchase tracking numbers for international orders (they can cost around $30, unless you would like to pay this fee for the international tracking number) but I do provide a customs form number which is automatically  given for international packages. I am more than happy to express mail packages, but you will be expected to cover the additional shipping costs and I must be notified of requiring express mail at time of purchase.\r\n\r\n**Please let me know upon purchasing a garment if you will need it express mailed to you. Often I receive messages/emails later than this that an order is needed for a birthday or event sooner. This is usually not an issue as processing times are just a few days for most orders and are shipped out quite fast, but please let me know regardless if you have any special request and I will be happy to express mail. Again, you will be expected to cover any additional shipping charges.**\r\n\r\nRegarding shipping costs - I list costs as fairly and accurately as I possibly can. Both shipping and handling are taken into consideration for this. Please know that I keep shipping prices as fair and accurate as I possibly can for you the customer and so that I can keep this shop up and running! \r\n\r\nINTERNATIONAL ORDERS -  If a tax is imposed on you by your post office/government it is completely out of my control. I pay the full amount of postage asked at USPS when I ship out.  Please be aware of the taxes required of you when ordering from oversea locations, as it is your responsibility. If you do not wish to pay this tax your post office will hold the package for a certain amount of time and then send it back to me. After this I will not issue a refund and I cannot ship it back to you unless you pay for shipping. \r\n\r\nCustomers are responsible for taxes and duties in their own country, I will not mark parcels as &#39;Gifts&#39; or lower the price on the item so a customer can avoid taxes. This is illegal and all requests to do so will be refused. \r\n*****",
"policy_refunds": "*REFUNDS & EXCHANGES*\r\n\r\nRegarding Returns: I only accept returns for garments that are not custom or have been made with special requests. For example, if you requested to have a certain design featured in my shop printed onto another garment outside of the product listing photos, then this will be considered a custom order and will not qualify for a return. I include as much sizing information, measurements, and any other important details to size, fit, and appearance of the garment so that this is all made clear in each listing before purchase. If your order qualifies for a return, you MUST send the garment back to me within 14 DAYS after receiving it. I can confirm all of this through tracking information and confirmation of delivery. The garment must be in the impeccable condition (unworn) that it was sent out to you in.\r\n\r\nRegarding Exchanges: Sometimes little flip flops arise and if I have accidentally sent you the wrong size or garment then I will be happy to do an exchange and I will take care of all the shipping costs. The faulty garment will have to be sent back to me before completing the exchange, however. ",
"policy_additional": "*CARE & WASH INSTRUCTIONS* \r\n\r\nYou will receive information on how to care for your garment(s) along with your package. Digitally printed garments are totally machine washable, and you can toss them in the dryer as well. Garments printed by heat press can be machine washed, but I do advise to wash them by hand, and to also let air dry. (If you do choose to wash and dry items printed by heat press always use gentle settings and only a little detergent for the wash.) \r\n\r\nHandmade Lingerie: Hand wash with a small amount of mild detergent. An easy and quick trick for washing and handling lingerie and delicates is to wash them in the shower. \r\n\r\n*SIZING INFORMATION* \r\n\r\nI am stocking and listing a fairly good variety of garments now. Each listing contains sizing information and measurements. I will soon be listing that information here as well for every individual style garment available in my shop. ",
