"description": "Are you the biggest classic horror nut you know?  Or do you have that friend who is absolutely OBSESSED with Halloween?  Look no further, because these monster hearts are for you!  Each heart is made with little details which connect them to their old Hollywood inspiration.\r\n\r\nThe Vampire heart comes complete with large blood dripping fangs, as well as eerie glowing eyes.\r\n\r\nFranky has stichted forehead, classic jagged edge hair, and bolts in his neck to round out the look.\r\n\r\nOur Witch comes with a little black pointed hat and green nose—complete with warts!\r\n\r\nJack-o, our beloved Jack-o-Lantern has a crooked smile to match his crooked stem.\r\n\r\nOur Wolfman—we like to call him Rolf—comes complete with spiked eyebrows and chin-fur.\r\n\r\nWhich leaves the Ghost for last.  During daylight hours, he seems somewhat ordinary.  But beware!  Once the lights go out he glows!\r\n\r\nEach heart is handmade in the USA from polymer clay and acrylic paint.  Gloss finished (not shown in photo).  Each pendant comes with a long chain—large enough for an adult.",
