"title": "Zombie Breath Soap",
"description": "Ever wonder what a zombie&#39;s breath would smell like?  It might surprise you :)\r\n\r\nHandmade and handcut, our soaps may vary in size, shape and color. \r\n-Each bar weighs between 4.5 oz and 5.0 oz. The dimensions are approximately 3.25 inches tall, 2.25 inches wide, and 1.0 inches thick. \r\n\r\nINGREDIENTS: Olive Oil, Coconut Oil, Castor Oil, Rice Bran Oil, Shea Butter, Distilled Water, Lye*, Kaolin Clay, Fragrance, Glycerin Soap Base, Pigments, Micas, Cosmetic Safe Glitter\r\n\r\n*Used as a saponifying agent to turn oils into &quot;true&quot; soap. All &quot;true&quot; natural soaps made from scratch are made with oils and an alkali salt (lye). Our superfatting method ensures that lye is no longer present or active in the final product.\r\n_______________________________________________________________________\r\n\r\nPurple Lily Studio artisan soaps are handmade in small batches, with quality ingredients for a natural cleansing experience. \r\n\r\nDue to the high glycerin content of our soaps, we recommend storing them out of the reach of running water. To extend shelf life, store the soap between usages on a soap deck, preferably on a window ledge or a well-ventilated area. \r\n\r\nDisclaimer: The statements presented above are for educational purposes only and have not been evaluated by the FDA. The products offered on this website are not intended to diagnose, treat, cure, or prevent any diseases. \r\n\r\nIf you are allergic to any of the ingredients listed, you may have an allergic reaction to our products. To test for allergies, rub and foam the soap sparingly along the inside of your elbow. Wash off and wait for 24 hours to check for any reaction that you may have before use.\r\n\r\nThank you for stopping by!",
