"accepts_custom_requests": true,
"policy_welcome": "Purple Lily Studio is dedicated to providing soaps made with all-natural ingredients. Our mission is to provide a healthier, less chemical-laden bath and body experience.",
"policy_payment": "Purple Lily Studio currently accepts Credit Card Payment via Etsy Direct Checkout, Money Orders and Personal Checks (US only).\r\n\r\nItems will ship once payment has cleared.  There is a $35 fee for NSF checks.\r\n\r\nWholesale orders: Please allow a minimum of 3 weeks for your order to be ready to ship.  50% payment required up front, balance due before items ship.",
"policy_shipping": "All packages are shipped to the address listed in the Etsy checkout. If you require shipping to another address, please let us know in the note section during checkout.... or contact us directly.\r\n\r\nMaryland residents are subject to a 6% sales tax. \r\n\r\nFor domestic orders, we ship either USPS First Class or USPS Priority Mail depending on the size of the order. USPS shipping can be unpredictable and we cannot guarantee shipment time. If you would like to pay for faster shipping options for the products you wish to purchase, please contact us directly. We provide tracking for all domestic purchases.\r\n\r\nFor international orders, we ship via USPS First Class International Mail or, International Priority Mail . Please be aware that we are unable to ship to certain countries due to import restrictions. For example, Peru is one of the few countries that prohibit the import of soaps and other bath and body products. Before ordering, please check your country&#39;s restrictions at the following link to see if your country permit the import of our products: http://pe.usps.com/text/imm/immctry.htm or simply contact us for help.\r\n\r\nBy ordering, you agree to pay for any tariffs or other customs fees at the border; we are not responsible for tariffs or fees.\r\n\r\nIn order to keep shipping cost low for our international customers, we do not voluntarily offer tracking. If you would like to track your shipment, we can arrange it for an additional fee. Please contact us for information about tracking international orders.\r\n\r\nUpon request, for an additional fee, shipping insurance is available for both domestic and international orders. We are not responsible for lost packages.",
"policy_refunds": "Purple Lily Studio cares about customer satisfaction. Great care is taken in writing product descriptions to represent our products in an honest and ethical manner. Should you have any questions regarding our products after reviewing our product descriptions, please contact us; we respond promptly. \r\n\r\nIf you are unhappy with your purchase for whatever reason, please contact us as soon as you can. Due to the nature of the product, we cannot accept returns, but we are more than open to working out a solution with you. We stand by our products and want you to be a satisfied and returning customer.",
"policy_additional": "The palm oil used in Purple Lily Studio products comes from a certified supplier that is a member of the RSPO group. So, please rest assure if you are concerned about the harvesting of palm trees affecting wildlife habitats. We care, too.\r\n\r\nWe list all of the ingredients used in our soap bars so that you can make an informed decision about your purchase(s). If you are allergic to any of the ingredients listed, please do not purchase the product in question. Our soaps are very gentle on the skin, and while allergic reactions to our products are rare, we encourage ultra-sensitive people with allergies to be cautious.\r\n\r\nWe make all of our soaps in small batches.  Our soap bars and blocks are hand poured and hand cut, so please expect some imperfections in design and/or cut.\r\n\r\nWholesale orders: Please allow a minimum of 3 weeks for your order to be ready to ship.  50% payment required up front, balance due before items ship.",
