"title": "Unique Gifts and Artsy Fartsy Stuff by Jbirdistheword",
"announcement": "I&#39;m on Facebook! https://www.facebook.com/Jbirdistheword\r\n \r\nHello! Thanks for stopping by my store. I&#39;m sure the first question you have is &quot;Do you really make all of your pendants?&quot; The answer is YES I do! I purchase the rights to the artwork, all the supplies, and spend lots of time in my home studio making them to perfection. I also have photography for sale, and I&#39;m starting to design and print T-shirts. \r\n\r\nIMPORTANT NOTICE: If you have a special deadline please let me know before buying so that I can try to help you out. There is absolutely no guaranteed timeline for custom artwork since I must always rely on the customer to provide feedback on proofs within a timely manner. I want you to be 100% satisfied with your handmade product. Please convo me if anything is wrong or not what you expected. I&#39;m happy to offer refunds and exchanges. \r\n\r\nContact me if you have any special requests.\r\nWholesale orders are welcome just contact me.\r\n\r\nCheck out my blog for more information on my art:\r\n \r\nhttp://www.jbirdistheword.com\r\n\r\nJoin my facebook page for new artwork and updates:\r\n\r\nhttps://www.facebook.com/Jbirdistheword\r\n \r\n\r\nThanks for visiting my store. Here is some background info on me:\r\n\r\nI attended the Art Institute of Pittsburgh from 2000-2003 and graduated with a degree in animation. Pretty cool huh? I mostly freelance out of my house and do various things such as photography, graphic design, and coming up with stuff to sell on the internet using my artwork. I love what I do and I hope you love what I have to offer! Feel free to ask me questions or ask for special products. I&#39;ll try and help you as much as I possibly can. If you&#39;re more curious about me then visit my full website at: http://www.jbirdistheword.com\r\n\r\n&quot;Official Etsy Massacre Team Member: Search &quot;EtsyMassacre&quot; for horror movie inspired art and creations made by team members of the Etsy Massacre Team! If it&#39;s gorey, creepy, scary, undead, monsterous, or bloody we have it!! Visit our blog spot at http://etsymassacre.blogspot.com/ for product updates, special sales and other horror movie related goodness!\r\n",
"currency_code": "USD",
"is_vacation": false,
"vacation_message": "I&#39;m on vacation until August 22nd and will reopen then. ",
"sale_message": " I want you to be 100% satisfied with your handmade product. Please convo me if anything is wrong or not what you expected. I&#39;m happy to offer refunds and exchanges. \r\n\r\n&quot;PLEASE NOTE: NEW ETSY FEATURE - PLEASE BE CAREFUL!!\r\n\r\nEtsy has recently added a &#39;report an issue&#39; button on your reciept for your purchase. You may choose &#39;report non-delivery&#39; or &#39;report item not as described&#39;.\r\nThis DOES NOT send a report directly to me, but OPENS A DISCIPLINARY CASE against me by the Etsy Administration. There has been a lot of confusion (and heartache) here on Etsy due to this new and unclear option on your receipt.\r\nIf you have a question about delivery of your item, please contact me directly through the convo system, and we will get it resolved right away. As always, my goal is for you to be completely and utterly thrilled by your purchase!&quot;\r\n\r\nAs seen in my shop announcement:\r\nIMPORTANT NOTICE: If you have a special deadline please let me know before buying so that I can try to help you out. There is absolutely no guaranteed timeline for custom artwork since I must always rely on the customer to provide feedback on proofs within a timely manner. I want you to be 100% satisfied with your handmade product. Please convo me if anything is wrong or not what you expected. I&#39;m happy to offer refunds and exchanges. \r\n\r\nCheck out my blog for more information on my art:\r\n \r\nhttp://www.jbirdistheword.com\r\n\r\nJoin my facebook page for new artwork and updates:\r\n\r\nhttps://www.facebook.com/Jbirdistheword\r\n\r\n&quot;Official Etsy Massacre Team Member: Search &quot;EtsyMassacre&quot; for horror movie inspired art and creations made by team members of the Etsy Massacre Team! If it&#39;s gorey, creepy, scary, undead, monsterous, or bloody we have it!! Visit our blog spot at http://etsymassacre.blogspot.com/ for product updates, special sales and other horror movie related goodness!",
