"accepts_custom_requests": true,
"policy_welcome": "Thank you so much for shopping in my store. You can always contact me with any questions you may have by convoing me through Etsy or by email: jbirdistheword [!at] yahoo.com.\r\n\r\nI try to respond ASAP but on some weekends I may be doing an art show or be out of town and will try to respond within 24-48 hours.",
"policy_payment": "IT CAN TAKE UP TO 2 MONTHS TO RECEIVE YOUR ORDER IF ORDERING OUTSIDE OF THE USA OR CANADA. If you want your items sooner, let me know BEFORE ordering so that we can work out another way to ship them. You will be charged extra for this service.\r\n\r\nYou do not need a PayPal Account to pay for your items through PayPal:\r\n\r\nYou can choose the PayPal Option during checkout. After you submit your order click the &quot;Pay Now&quot; button. Scroll Down and you will see the option to pay with a Credit or Debit Card WITHOUT having to sign up for a PayPal account.&quot;\r\n\r\nIf you pay by check I will wait until it clears before filling your order. \r\n\r\nIf sending a money order I will wait until I receive it before filling your order.\r\n\r\nTax is already included with every order.\r\n\r\nI also accept Visa, Mastercard, and Paypal.",
"policy_shipping": "IT CAN TAKE UP TO 2 MONTHS TO RECEIVE YOUR ORDER IF ORDERING OUTSIDE OF THE USA OR CANADA. If you want your items sooner, let me know BEFORE ordering so that we can work out another way to ship them. You will be charged extra for this service.\r\n\r\nI ship within 5 business days (Excludes weekends). I try to reuse boxes and materials instead of buying new and cluttering up our landfills. :) Everything comes from a smoke-free home.\r\n\r\nI typically wrap things in newspaper as it is more sturdy and protective than tissue paper. Pendants and magnets come in nice organza bags and prints are in plastic sleeves with acid free boards.\r\n\r\nIf however you have a special deadline please convo me prior to ordering and I&#39;ll try my hardest to make sure you can get your order before you need it.",
"policy_refunds": "If you are not 100% happy with anything, feel free to contact me BEFORE leaving feedback. I can do exchanges or refunds... depending on what you want me to do. GREAT customer service is my number 1 goal!\r\n\r\nIf something gets lost in the mail, I&#39;ll resend it to you. Everything in the USA gets a tracking number but sometimes accidents happen. If by the 2nd time you do not receive it or it gets lost again I would recommend an alternative address for me to ship to.\r\nI want my customers to be 100% satisfied. Just let me know what you want me to do to achieve that. Please purchase seriously.",
"policy_additional": "If you would like to feature me on your blog or other venue please contact me as I love the exposure! I do wholesale too just contact me for details.\r\n\r\nWholesale FAQ&#39;s:\r\n\r\n&quot;Do you do wholesale?&quot;\r\nYes I do! I just need proof of your tax ID number to do resale for my accounting.\r\n\r\n&quot;What are your prices for wholesale?&quot;\r\nEverything in my store is set at retail price and to figure out the wholesale price just divide by 2 and that&#39;s 50% off of the retail price. This is standard wholesale pricing. For example if I have something listed at $9.99 then the wholesale price would be $4.99. Depending on how much product you order I could give more of a discount than that. ALL pendant wholesale orders come with free chains for each pendant. They are also packaged in organza bags!\r\n\r\n&quot;What is your minimum wholesale order?&quot;\r\nAfter applying your 50% discount the total has to amount to $100 total to qualify for wholesale. So if you ordered pendants at 4.99 each for your $100 order you will be receiving 20 pendants!\r\n\r\n&quot;How do I order wholesale from your Etsy store?&quot;\r\nRight now Etsy doesn&#39;t have a special way to order wholesale so instead when we have everything worked out I will give you a coupon code for 50% off so that you can order everything you want VERY easily. \r\n\r\n&quot;How much is shipping?&quot;\r\nShipping in the USA and Canada is FREE via USPS and comes with a tracking number. If you need an order shipped outside these 2 countries please let me know before ordering so I can give you an estimate. If you want it shipped via UPS let me know and I&#39;ll get you an estimate.\r\nIT CAN TAKE UP TO 2 MONTHS TO RECEIVE YOUR ORDER IF ORDERING OUTSIDE OF THE USA OR CANADA. If you want your items sooner, let me know BEFORE ordering so that we can work out another way to ship them. You will be charged extra for this service.\r\n\r\n&quot;How long does it take to complete an order?&quot;\r\nSince I hand make everything myself it takes at least 2 weeks to complete your order. Very large orders or special needs orders can take longer especially around the holidays such as Christmas. Let me know what you&#39;re interested in and we&#39;ll go from there on an estimate of time.\r\nIT CAN TAKE UP TO 2 MONTHS TO RECEIVE YOUR ORDER IF ORDERING OUTSIDE OF THE USA OR CANADA. If you want your items sooner, let me know BEFORE ordering so that we can work out another way to ship them. You will be charged extra for this service.\r\n\r\n",
